import React,{Component} from 'react';
import { Link } from 'react-router-dom';

import { requests } from '../json/requests.json'

class RequestList extends Component{
  constructor(){
      super();
      this.state={
        requests
      }

    }
  // componentWillMount() {
  //   fetch('https://www.mwork.com.ar/empleados')
  //     .then((response) => {
  //       return response.json()
  //     })
  //     .then((empleados) => {
  //       this.setState({ data: result.data })
  //     })
  // }
    render(){

      const requests=this.state.requests.map((request,i)=>{
        return(
          <div className="row">
            <div className="col-lg list-item">
              <h5>#{request.nid} {request.creation_date} <span class="badge badge-success">Resoluci√≥n</span> <span class="badge badge-danger">Urgente</span></h5>
              <h5>{request.asset.type} {request.asset.mark} {request.asset.model}</h5>
            </div>
          </div>
        )
      })
      return(
        <div className="container">
        <div className="row row-header bg-success">
        <div className="col-lg">
          Solicitudes MC
        </div>

        </div>
          {requests}
          <div className="row" style={{marginTop:'20px'}}>
            <div className="col-md-4" style={{textAlign:'center'}}>
              <Link to="/"><button type="button" className="btn btn-outline-secondary btn-lg btn-full">Regresar</button></Link>
            </div>
          </div>
        </div>
      )
    }
}

export default RequestList;
